import './style/style.css';

function App() {
  return (
    <div class="counter">
      <div class="counter__text"><h5>Counter: <span class="number"></span> </h5></div>
      <button class="counter__add">Add</button>
      <button class="counter__sub">Reduce</button>
      <button class="counter__async">Async</button>
    </div>
  );
}

export default App;
